function Env(name) {
  const isLoon = typeof $loon !== "undefined";
  const isSurge = typeof $httpClient !== "undefined" && !isLoon;
  const isQX = typeof $task !== "undefined";

  const log = (...args) => console.log(`[${name}]`, ...args);
  const getdata = (key) => {
    if (isQX) return $prefs.valueForKey(key);
    if (isSurge || isLoon) return $persistentStore.read(key);
  };
  const setdata = (val, key) => {
    if (isQX) return $prefs.setValueForKey(val, key);
    if (isSurge || isLoon) return $persistentStore.write(val, key);
  };
  const msg = (title, sub = "", body = "", opts = {}) => {
    if (isQX) $notify(title, sub, body, opts);
    else if (isSurge || isLoon) $notification.post(title, sub, body, opts);
    else log(title, sub, body);
  };
  const request = (method, opts) => {
    return new Promise((resolve, reject) => {
      const cb = (err, resp, body) => err ? reject(err) : resolve({ status: resp.status || resp.statusCode, headers: resp.headers, body });
      if (isQX) {
        opts.method = method;
        $task.fetch(opts).then(r => cb(null, r, r.body), e => cb(e));
      } else {
        $httpClient[method.toLowerCase()](opts, cb);
      }
    });
  };
  const done = (v = {}) => { if (typeof $done !== "undefined") $done(v); };

  return { 
    name, log, getdata, setdata, msg, done, 
    http: { get: (opts) => request("GET", opts), post: (opts) => request("POST", opts) } 
  };
}
